const logo =
  'data:image/png;base64,';

const getQuoteHtml = (quote) => `
<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8" />

  <style>
    @page {
      margin: 120px 40px 40px 40px;
    }

    body {
      margin: 0;
      font-family: Arial, Helvetica, sans-serif;
      font-size: 12px;
      color: #000;
    }


    .logo {
      text-align: center;
      margin-bottom: 10px;
    }

    .logo img {
      height: 70px;
    }

    .company-name {
      text-align: center;
      font-size: 15px;
      font-weight: bold;
    }

    .company-meta {
      text-align: center;
      font-size: 11px;
      margin-bottom: 20px;
    }

    .divider {
      border-top: 2px solid #000;
      margin: 15px 0;
    }

    .top-info {
      display: flex;
      justify-content: space-between;
      margin-bottom: 20px;
    }

    .top-info p {
      margin: 4px 0;
    }

    h2 {
      text-align: center;
      margin: 25px 0 10px;
      text-transform: uppercase;
    }


    table {
      width: 100%;
      border-collapse: collapse;
      margin-top: 20px;
    }

    th, td {
      border: 1px solid #000;
      padding: 8px;
    }

    th {
      background: #f2f2f2;
      text-align: center;
    }

    .text-right {
      text-align: right;
    }

    .totals {
      margin-top: 15px;
      width: 100%;
    }

    .totals td {
      border: none;
      padding: 6px;
    }

    .terms {
      margin-top: 25px;
    }

    /* ===== FOOTER SPACE (CRITICAL) ===== */
    .footer-space {
      height: 130px; /* MUST match footer height */
    }

    /* ===== FOOTER ===== */
    .footer {
      position: fixed;
      bottom: 0;
      left: 0;
      right: 0;

      height: 130px;
      padding: 15px 40px;

      font-size: 11px;
      line-height: 1.5;

      border-top: 1px solid #000;
      background: #fff;
    }

    .footerInfo {
      text-align: center;
    }

    #address {
      color: #666;
    }

    #contacts {
      color: #b00000;
    }
  </style>
</head>

<body>

  <!-- LOGO -->
  <div class="logo">
    <img src="${logo}" />
  </div>

  <!-- COMPANY INFO -->
  <div class="company-name">TechSynergy Innovations Pvt Ltd</div>
  <div class="company-meta">
    <strong>NTN & STRN:</strong> G141420 / 3277876371499
  </div>

  <div class="divider"></div>

  <!-- TO + DATE -->
  <div class="top-info">
    <div>
      <p><strong>To,</strong></p>
      <p>${quote.contact?.firstName || ''} ${quote.contact?.lastName || ''}</p>
      <p style='width: 200px'>${quote.account.billingAddress?.street || ''}, ${quote.account.billingAddress?.city || ''}</p>,
      <p>${quote.account.billingAddress?.state || ''}, ${quote.account.billingAddress?.country || ''}</p>
    </div>

    <div class="text-right">
      <p><strong>Date:</strong> ${new Date(quote.createdAt).toLocaleDateString()}</p>
      <p><strong>Quote No:</strong> ${quote.quoteNumber}</p>
    </div>
  </div>

  <h2> ${quote.quoteStage === 'Confirmed' || quote.quoteStage === 'Closed Won' ? 'Sell order' : 'Quotation'}  for ${quote.subject}</h2>

  <p>
    Dear ${quote.contact?.firstName || 'Sir/Madam'},<br/><br/>
    Reference to your requirement, we are pleased to submit our financial proposal as below:
  </p>

  <!-- PRODUCTS -->
  <table>
    <thead>
      <tr>
        <th style="width:5%">S.No</th>
        <th>Product Description</th>
        <th style="width:15%">Unit Price</th>
        <th style="width:10%">Qty</th>
        <th style="width:15%">Line Total</th>
      </tr>
    </thead>
    <tbody>
      ${quote.products
        .map(
          (p, i) => `
        <tr>
          <td class="text-right">${i + 1}</td>
          <td>${p.productName}</td>
          <td class="text-right">${quote.currency} ${p.listPrice.toLocaleString()}</td>
          <td class="text-right">${p.quantity}</td>
          <td class="text-right">${quote.currency} ${p.total.toLocaleString()}</td>
        </tr>
      `
        )
        .join('')}
    </tbody>
  </table>

  <!-- TOTALS -->
  <table class="totals">
    <tr>
      <td class="text-right"><strong>Total:</strong></td>
      <td class="text-right">${quote.currency} ${quote.subTotal.toLocaleString()}</td>
    </tr>
    <tr>
      <td class="text-right">
        <strong>GST ${quote.isGstApplied ? 'Inclusive' : 'Exclusive'}:</strong>
      </td>
      <td class="text-right">${quote.currency} ${quote.gstAmount.toLocaleString()}</td>
    </tr>
    <tr>
      <td class="text-right"><strong>Grand Total:</strong></td>
      <td class="text-right">
        <strong>${quote.currency} ${quote.grandTotal.toLocaleString()}</strong>
      </td>
    </tr>
  </table>

  <!-- TERMS -->
  <div class="terms">
    <strong>Terms & Conditions:</strong>
    <ul>
      <li>
        This quotation is valid until
        ${
          quote.validUntil
            ? new Date(quote.validUntil).toLocaleDateString()
            : '-'
        }
      </li>
      ${(quote.termsAndConditions || [])
        .filter((t) => t.trim())
        .map((t) => `<li>${t}</li>`)
        .join('')}
    </ul>
  </div>

  <!-- CRITICAL SPACER -->
  <div class="footer-space"></div>

  <!-- FOOTER -->
  <div class="footer">
    <strong>Best Regards,</strong><br/>
    ${quote.quoteOwner?.name || ''}<br/>
    ${quote.quoteOwner?.email || ''}<br/>
    TechSynergy Innovations Pvt Ltd

    <div class="footerInfo">
      <p id="address">
        Address: Plot 15C, Office #1, First Floor, Badar Commercial Street 10,
        Phase V Ext, DHA Karachi
      </p>
      <p id="contacts">
        www.techsynergypk.com | info@techsynergypk.com | 0337-8328310
      </p>
    </div>
  </div>

</body>
</html>
`;

module.exports = getQuoteHtml;
